package com.biz.test_1112;

public class ForinFor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i = 0 ; i < 3 ; i ++) {
			System.out.println("==============================");
			for(int j = 0 ; j < 3 ; j ++) {
				System.out.print("[" + i + ", " + j + "] ");
			}
			System.out.println('\n');
		}

	}

}
